import React from "react"
import CardPayment from "./CardPayment"
import Grid from '@mui/material/Grid'

const Step4 = () => {
  return (
      <>
        <Grid container
          justifyContent="space-evenly"
          spacing={5}
          sx={{ pt: 5 }}
        >
          <Grid item xs={5}>
            <CardPayment/>
          </Grid>
        </Grid>
      </>
  )
}

export default Step4
